import { Counter } from './features/counter/Counter';
import './App.css';
 import ProductList from './features/product-list/components/ProductList.js';
 import Navbar from './features/navbar/Navbar';
import LoginPage from './pages/LoginPage.js';
import Signup from './features/auth/components/Signup.js';
 import Home from './pages/Home';
import ReactDOM from "react-dom/client";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import SignupPage from './pages/SignupPage.js';
import Cart from './features/cart/Cart.js';
import Checkout from './pages/Checkout.js';
import ProductDetail from './features/product-list/components/ProductDetail.js';
function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />}/>
        <Route path="/login" element={<LoginPage/>} />
        <Route path="/signup" element={<SignupPage/>} />
        <Route path="/cart" element={<Cart/>} />
        {/* For testing checkout page */}
        <Route path="/checkout" element={<Checkout/>} />
        <Route path="ProductDetailPage" element={<ProductDetailPage/>} />
      </Routes>
    </BrowserRouter>
  );

}

export default App;
